const OutTable = (props) => {
  return (
    <div className="table-responsive">
      <table className="table table-striped">
        <thead>
          <tr>
            {props.cols.map((c) => (
              <th key={c.key}>{c.name}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {props.data.filter((r, i) => {
            return props.data[i][0] === undefined;
          })}
          {props.data.map(
            (r, i) => (
              console.log(props.data[i][0] === undefined),
              (
                <tr key={i}>
                  {props.cols.map((c) => (
                    <td key={c.key}>{r[c.key]}</td>
                  ))}
                </tr>
              )
            )
          )}
        </tbody>
      </table>
    </div>
  );
};

export default OutTable;
